#include <string>
#include <vector>
#include <cmath>

class Solution {
public:
    long long numberOfPowerfulInt(long long start, long long finish, int limit, std::string s) {
        long long count = 0;
        long long sInt = std::stoll(s);
        long long sLength = s.length();
        long long power = std::pow(10, sLength);

        // Check if sInt is within the start and finish range directly
        if (sInt >= start && sInt <= finish) count++;

        // Generate all powerful integers by prefixing s with digits <= limit
        for (long long prefix = 1; prefix <= power; prefix *= 10) {
            for (int digit = 1; digit <= limit; ++digit) {
                long long num = digit * prefix * power + sInt;
                if (num > finish) break; // No need to continue if num exceeds finish
                if (num >= start && num <= finish) count++;
            }
        }

        return count;
    }
};
